import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import Navvbar from './Components/navbar.js';
import './style.css';
import Home from './Components/Home';

function App() {
  return (
    <div className="container">
      <Navvbar navbar={Navvbar}/>
      <Home home={Home}/>

    </div>
  );
}

export default App;
